// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/operatorforwarder/ChainlinkClient.sol";
import "@chainlink/contracts/src/v0.8/shared/access/ConfirmedOwner.sol";

contract DamageDetectionConsumer is ChainlinkClient, ConfirmedOwner {
    using Chainlink for Chainlink.Request;

    // Chainlink configuration
    bytes32 private jobId;
    uint256 private fee;
    
    // Your ML API endpoint
    string public apiEndpoint = "http://127.0.0.1:5000/predict";
    
    // Prediction results
    struct PredictionResult {
        uint256 damageScore;    // 0-100 scale
        string prediction;      // "fresh" or "rotten"
        uint256 confidence;     // 0-100 scale
        uint256 timestamp;
        bool fulfilled;
    }
    
    mapping(bytes32 => PredictionResult) public predictions;
    mapping(bytes32 => address) public requesters;
    
    // Events
    event PredictionRequested(bytes32 indexed requestId, string imageUrl);
    event PredictionReceived(
        bytes32 indexed requestId, 
        uint256 damageScore, 
        string prediction,
        uint256 confidence
    );

    constructor() ConfirmedOwner(msg.sender) {
        _setChainlinkToken(0x779877A7B0D9E8603169DdbD7836e478b4624789); // Sepolia LINK
        _setChainlinkOracle(0x6090149792dAAeE9D1D568c9f9a6F6B46AA29eFD); // Sepolia Oracle
        
        // Job ID for GET request - updated for new Chainlink
        jobId = "ca98366cc7314957b8c012c72f05aeeb"; // Updated GET > uint256 job
        fee = (1 * LINK_DIVISIBILITY) / 10; // 0.1 LINK
    }
    
    function requestDamagePrediction(string memory imageUrl) 
        public 
        returns (bytes32 requestId) 
    {
        Chainlink.Request memory req = _buildChainlinkRequest(
            jobId,
            address(this),
            this.fulfill.selector
        );
        
        // Set the URL with image parameter
        string memory fullUrl = string(abi.encodePacked(
            apiEndpoint,
            "?image_url=",
            imageUrl
        ));
        
        // NEW SYNTAX: Use _add instead of add
        req._add("get", fullUrl);
        req._add("path", "damage_score"); // Extract damage_score from JSON response
        
        // Optional: Add headers if your API requires them
        // req._add("headers", "Content-Type: application/json");
        
        // Send the request
        requestId = _sendChainlinkRequest(req, fee);
        
        // Store requester
        requesters[requestId] = msg.sender;
        
        emit PredictionRequested(requestId, imageUrl);
        return requestId;
    }
    
    function fulfill(bytes32 _requestId, uint256 _damageScore)
        public
        recordChainlinkFulfillment(_requestId)
    {
        // Store result
        predictions[_requestId] = PredictionResult({
            damageScore: _damageScore,
            prediction: _damageScore > 50 ? "rotten" : "fresh",
            confidence: 0, // Will be updated if needed
            timestamp: block.timestamp,
            fulfilled: true
        });
        
        emit PredictionReceived(
            _requestId, 
            _damageScore, 
            predictions[_requestId].prediction,
            0
        );
    }
    
    function getPrediction(bytes32 requestId) 
        public 
        view 
        returns (
            uint256 damageScore,
            string memory prediction,
            uint256 timestamp,
            bool fulfilled
        ) 
    {
        PredictionResult memory result = predictions[requestId];
        return (
            result.damageScore,
            result.prediction,
            result.timestamp,
            result.fulfilled
        );
    }
    
    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(_chainlinkTokenAddress());
        require(
            link.transfer(msg.sender, link.balanceOf(address(this))),
            "Unable to transfer"
        );
    }
    
    function updateApiEndpoint(string memory newEndpoint) public onlyOwner {
        apiEndpoint = newEndpoint;
    }
    
    // Additional utility functions for better integration
    function getRequestStatus(bytes32 requestId) 
        public 
        view 
        returns (bool exists, bool fulfilled) 
    {
        return (
            requesters[requestId] != address(0),
            predictions[requestId].fulfilled
        );
    }
    
    function getRequester(bytes32 requestId) 
        public 
        view 
        returns (address) 
    {
        return requesters[requestId];
    }
}

contracts/EmergencyManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract EmergencyManager {
    address public admin;
    bool public paused;
    mapping(address => bool) public blacklisted;

    event Paused(address indexed admin);
    event Unpaused(address indexed admin);
    event Blacklisted(address indexed user);
    event Unblacklisted(address indexed user);
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin");
        _;
    }

    constructor(address _admin) {
        admin = _admin;
        paused = false;
    }

    function pause() external onlyAdmin { paused = true; emit Paused(msg.sender); }
    function unpause() external onlyAdmin { paused = false; emit Unpaused(msg.sender); }
    function blacklist(address user) external onlyAdmin { blacklisted[user] = true; emit Blacklisted(user); }
    function unblacklist(address user) external onlyAdmin { blacklisted[user] = false; emit Unblacklisted(user); }
    function isBlacklisted(address user) external view returns (bool) { return blacklisted[user]; }
    function isPaused() external view returns (bool) { return paused; }
}

contracts/TemperatureOracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@chainlink/contracts/src/v0.8/operatorforwarder/ChainlinkClient.sol";
import "@chainlink/contracts/src/v0.8/shared/access/ConfirmedOwner.sol";

contract TemperatureOracle is ChainlinkClient, ConfirmedOwner {
    using Chainlink for Chainlink.Request;

    uint256 private constant ORACLE_PAYMENT = 1 * LINK_DIVISIBILITY; // 1 * 10**18
    bytes32 private jobId;
    uint256 private fee;

    // Events
    event RequestTemperature(bytes32 indexed requestId, uint256 productId);
    event TemperatureReceived(bytes32 indexed requestId, uint256 temperature, uint256 productId);
    event CriticalTemperatureDetected(uint256 indexed productId, uint256 temperature);
    
    // Mapping to track which product ID is associated with each request
    mapping(bytes32 => uint256) public requestToProductId;
    mapping(bytes32 => address) public requestToRequester;
    mapping(uint256 => uint256) public latestTemperatureByProduct;

    constructor() ConfirmedOwner(msg.sender) {
        _setChainlinkToken(0x779877A7B0D9E8603169DdbD7836e478b4624789); // Sepolia LINK token
        _setChainlinkOracle(0x6090149792dAAeE9D1D568c9f9a6F6B46AA29eFD); // Sepolia Oracle
        jobId = "ca98366cc7314957b8c012c72f05aeeb"; // HTTP GET job ID for Sepolia
        fee = 0.1 * 10 ** 18; // 0.1 LINK
    }

    /**
     * Request temperature data for a specific product
     */
    function requestTemperatureForProduct(uint256 productId) public returns (bytes32 requestId) {
        Chainlink.Request memory request = _buildChainlinkRequest(jobId, address(this), this.fulfill.selector);
        
        // Set the URL to your Flask API
        request._add("get", "http://127.0.0.1:5001/sensor");
        
        // Set the path to find the temperature value in the response
        request._add("path", "temperature");
        
        // Multiply the result by 100 to preserve 2 decimal places (since Solidity doesn't handle decimals)
        request._addInt("times", 100);
        
        // Send the request
        requestId = _sendChainlinkRequest(request, fee);
        
        // Store the product ID and requester for this request
        requestToProductId[requestId] = productId;
        requestToRequester[requestId] = msg.sender;
        
        emit RequestTemperature(requestId, productId);
        return requestId;
    }

    /**
     * Receive the response in the form of uint256
     */
    function fulfill(bytes32 _requestId, uint256 _temperature) public recordChainlinkFulfillment(_requestId) {
        uint256 productId = requestToProductId[_requestId];
        address requester = requestToRequester[_requestId];
        
        // Convert back to actual temperature (divide by 100)
        uint256 actualTemp = _temperature / 100;
        
        // Store latest temperature for this product
        latestTemperatureByProduct[productId] = actualTemp;
        
        // Clean up mappings
        delete requestToProductId[_requestId];
        delete requestToRequester[_requestId];
    }

    /**
     * Get the latest temperature for a specific product
     */
    function getLatestTemperatureForProduct(uint256 productId) public view returns (uint256) {
        return latestTemperatureByProduct[productId];
    }

    /**
     * Helper function for quality assessment - gets current temperature for a product
     */
    function getCurrentTemperature(uint256 productId) external view returns (uint256) {
        return latestTemperatureByProduct[productId];
    }

    /**
     * Withdraw LINK tokens
     */
    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(_chainlinkTokenAddress());
        require(link.transfer(msg.sender, link.balanceOf(address(this))), "Unable to transfer");
    }
}

